import '../App.css'
import logo from '../assets/PokeTrumps logo.png';



const StartPage = () => {
    
    return (
        <header className= "App-header">
            Hello, welcome to 
            <img 
                src={logo} 
                className="App-logo" 
                alt="logo" style={{ width:350, height: 100 }} />
        </header>
        
    )
}

export default StartPage
